
/**
 * Provides counties in the US State of California.
 */
syntax = "proto3";

package opencannabis.geo.usa.ca;

option optimize_for = SPEED;
option objc_class_prefix = "BBS";
option java_package = "io.opencannabis.schema.geo.usa";
option java_multiple_files = false;
option java_outer_classname = "California";


